import React from 'react';
import { useHistory } from 'react-router-dom'; // Import useHistory for navigation

const ResumeGrid = () => {
  const history = useHistory(); // Initialize useHistory

  // Function to handle click on a resume
  const handleResumeClick = (resumeId) => {
    // Navigate to the resume page when a resume is clicked
    history.push(`/resume/${resumeId}`);
  };

  // Sample data for resumes
  const resumes = [
    { id: 1, title: 'Resume 1', description: 'Description for Resume 1' },
    { id: 2, title: 'Resume 2', description: 'Description for Resume 2' },
    { id: 3, title: 'Resume 3', description: 'Description for Resume 3' },
    // Add more resumes as needed
  ];

  return (
    <div className="resume-grid">
      {resumes.map((resume) => (
        <div key={resume.id} className="resume-item" onClick={() => handleResumeClick(resume.id)}>
          <h3>{resume.title}</h3>
          <p>{resume.description}</p>
        </div>
      ))}
    </div>
  );
};

export default ResumeGrid;
